function ExpanseItem(props){
    const month = props.date.toLocalString('en-US',{month:'Long'});
    return(
        <div className="expanse">
            <div className="expanse_date">
                <div></div>
                <div></div>
                <div></div>
            </div>
            <div className="expanse_item">
                <h3>{props.title}</h3>
                <p>${props.amount}</p>
            </div>
        </div>
    );
}

